import React from 'react'
import { useState } from 'react';

function Home() {
    const [blogs, setBlogs] = useState([
        { title: "L'amour de soi", body: "lorem ipsum...", author:"Hesper", id:1},
        { title: "D'anniversaire", body:"lorem ipsum...", author:"Hesper", id:2},
        { title: "Home", body:"", author:"Hesper", id:3}
    ]);

    return (
        <div>
            <div className="home">
                {blogs.map((blog) => (
                    <div className="blog-preview" key={blog.id}>
                        <h2>{ blog.title }</h2>
                        <p>Written By: { blog.author }</p>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Home
